var imgData = 'data:image/jpeg;base64,';

function ocrb(doc, startingX, y, str) {
    // OCR-B base64: siffror + # + >
    var ocr0 = 'data:image/png;base64,';
    var ocr1 = 'data:image/png;base64,';
    var ocr2 = 'data:image/png;base64,';
    var ocr3 = 'data:image/png;base64,';
    var ocr4 = 'data:image/png;base64,';
    var ocr5 = 'data:image/png;base64,';
    var ocr6 = 'data:image/png;base64,';
    var ocr7 = 'data:image/png;base64,';
    var ocr8 = 'data:image/png;base64,';
    var ocr9 = 'data:image/png;base64,';
    var ocrgt = 'data:image/png;base64,'; // ">"
    var ocrht = 'data:image/png;base64,'; // "#"

    var translate = {};
    translate['0'] = ocr0;
    translate['1'] = ocr1;
    translate['2'] = ocr2;
    translate['3'] = ocr3;
    translate['4'] = ocr4;
    translate['5'] = ocr5;
    translate['6'] = ocr6;
    translate['7'] = ocr7;
    translate['8'] = ocr8;
    translate['9'] = ocr9;
    translate['ht'] = ocrht;
    translate['gt'] = ocrgt;
    translate['space'] = null;

    var mmWidth = 2.54;
    var mmHeight = 2.88;
    //doc.addImage(imgData, 'JPEG', 0, 0, 210, 297);
    //doc.addImage(logoData, 'PNG', 16, 14, 42, 7);
    var x = startingX;

    //doc.addImage(ocrht, 'PNG', x, y, mmWidth, mmHeight);
    for (var i = 0, len = str.length; i < len; i++) {
        var key = str[i]; key = (key !== ' ' && key !== '>' && key !== '#') ? key : (key === ' ' ? 'space' : (key === '#' ? 'ht' : 'gt'))        
        var output = translate[key];
        
        if (output) {        
            doc.addImage(output, 'PNG', x, y, mmWidth, mmHeight);
        }      
        
        x += mmWidth;

    }
}